import React from 'react';

function Add(x,y)
{
let c = x+y;
return (c);
}

function Sub(x,y)
{
let d = x-y;
return (d);
}

function Mul(x,y)
{
let e = x*y;
return (e);
}


function Divi(x,y)
{
let z = x/y;
let s = z.toFixed(2)
return (s);
}
